import styled from 'styled-components';

export const Container = styled.header`
    background: var(--black-1);
`;

export const Content = styled.div`
        max-width: 1120px;
        margin: 0 auto;

        padding: 0.5rem 1rem 0.5rem;
        display: flex;
        align-items: center;
        justify-items: left;

        a{
            font-size: 1rem;
            color: var(--white-1);
        }

`;
